		baseReq.connect()
			.use(baseReq.bodyParser.json()) //JSON解析
			.use(baseReq.bodyParser.urlencoded({
				extended: true
			}))
			//use()方法还有一个可选的路径字符串，对传入请求的URL的开始匹配。
			//use方法来维护一个中间件队列
			.use(function(req, res, next) {
				//跨域处理
				// Website you wish to allow to connect
				//				res.setHeader('Access-Control-Allow-Origin', '*'); //允许任何源 用postman请求
				res.setHeader('Access-Control-Allow-Origin', req.headers.origin); //允许任何源 用react项目或者ajax请求
				// Request methods you wish to allow
				res.setHeader('Access-Control-Allow-Methods', 'GET, POST, OPTIONS, PUT, PATCH, DELETE'); //允许任何方法
				// Request headers you wish to allow
				res.setHeader('Access-Control-Allow-Headers', 'X-Requested-With,content-type,X-Session-Token, Authorization'); //允许任何类型
				res.setHeader('Access-Control-Allow-Credentials', 'true'); //是否允许后续请求携带认证信息（cookies）,该值只能是true,否则不返回
				res.writeHead(200, {
					"Content-Type": "application/json;charset=utf-8"
				}); //utf-8转码

				next(); //next 方法就是一个递归调用
			})
