					let obj = {}
					results.map(item => {
						temp = {}
						if(item.t1 !== undefined && typeof item.t1 != 'object') temp["1"] = item.t1
						if(item.t2 !== undefined && typeof item.t2 != 'object') temp["2"] = item.t2
						if(item.t3 !== undefined && typeof item.t3 != 'object') temp["3"] = item.t3
						if(item.t4 !== undefined && typeof item.t4 != 'object') temp["4"] = item.t4
						if(item.t5 !== undefined && typeof item.t5 != 'object') temp["5"] = item.t5
						if(item.t6 !== undefined && typeof item.t6 != 'object') temp["6"] = item.t6
						if(item.t7 !== undefined && typeof item.t7 != 'object') temp["7"] = item.t7
						if(item.t8 !== undefined && typeof item.t8 != 'object') temp["8"] = item.t8
						obj[item.mac_code] = temp
					});
					res.end(JSON.stringify(obj));
					next();
